import React from "react";
import { Row, Col, Container } from "react-bootstrap";
import { Link } from "react-router-dom";

const Footer = () => {
  return (
    <Container>
      <Row>
        <Col lg={4}>
          <h5>Company</h5>
        </Col>
        <Col lg={4}>2 of 3</Col>
        <Col lg={4}>3 of 3</Col>
      </Row>
    </Container>
  );
};

export default Footer;
